import React from 'react';
import { Bar } from 'react-chartjs-2';
import axios from 'axios';

export default function RerportsPage() {
    
    const state = {
    labels: ['January', 'February', 'March',
                'April', 'May'],
    datasets: [
            {
                label: 'Rainfall',
                backgroundColor: 'rgba(75,192,192,1)',
                borderColor: 'rgba(0,0,0,1)',
                borderWidth: 2,
                data: [65, 59, 80, 81, 56]
            }
        ]
    }

    return (

        <div>
            <Bar
            data={state}
            options={{
                    title:{
                        display:true,
                        text:'Liked Users Vacations',
                        fontSize:20
                    },
                    legend:{
                        display:true,
                        position:'right'
                    }
                }}
            />
        </div>
    )
}
